-- =====================================================
-- OEM EV WARRANTY MANAGEMENT SYSTEM - Database Schema & Data
-- =====================================================

-- Trigger function for updated_at
CREATE OR REPLACE FUNCTION update_updated_at_column()
RETURNS TRIGGER AS $$
BEGIN
    NEW.updated_at = CURRENT_TIMESTAMP;
    RETURN NEW;
END;
$$ language 'plpgsql';

-- =====================================================
-- 1. ROLES TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS roles (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    name VARCHAR(50) NOT NULL UNIQUE,
    description VARCHAR(255),
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TRIGGER trg_roles_updated_at BEFORE UPDATE ON roles FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =====================================================
-- 2. USERS TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS users (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    username VARCHAR(100) NOT NULL UNIQUE,
    password VARCHAR(255) NOT NULL,
    full_name VARCHAR(255),
    email VARCHAR(255) UNIQUE,
    phone VARCHAR(20),
    service_center VARCHAR(100),
    active BOOLEAN DEFAULT TRUE,
    last_login TIMESTAMP NULL,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TRIGGER trg_users_updated_at BEFORE UPDATE ON users FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =====================================================
-- 3. USER_ROLES JOIN TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS user_roles (
    user_id BIGINT NOT NULL,
    role_id BIGINT NOT NULL,
    PRIMARY KEY (user_id, role_id),
    FOREIGN KEY (user_id) REFERENCES users(id) ON DELETE CASCADE,
    FOREIGN KEY (role_id) REFERENCES roles(id) ON DELETE CASCADE
);

-- =====================================================
-- 4. CUSTOMERS TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS customers (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    full_name VARCHAR(255) NOT NULL,
    email VARCHAR(255) UNIQUE,
    phone VARCHAR(20),
    address VARCHAR(500),
    city VARCHAR(100),
    state VARCHAR(100),
    zip_code VARCHAR(20),
    country VARCHAR(100),
    id_number VARCHAR(50),
    id_type VARCHAR(50),
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TRIGGER trg_customers_updated_at BEFORE UPDATE ON customers FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =====================================================
-- 5. VEHICLES TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS vehicles (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    vin VARCHAR(17) NOT NULL UNIQUE,
    model VARCHAR(100),
    make VARCHAR(100),
    year INT,
    color VARCHAR(50),
    battery_type VARCHAR(100),
    battery_capacity DOUBLE PRECISION,
    motor_type VARCHAR(100),
    mileage INT DEFAULT 0,
    manufacture_date DATE,
    purchase_date DATE,
    registration_date DATE,
    warranty_start_date DATE,
    warranty_end_date DATE,
    status VARCHAR(20) DEFAULT 'ACTIVE',
    customer_id BIGINT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (customer_id) REFERENCES customers(id)
);

CREATE TRIGGER trg_vehicles_updated_at BEFORE UPDATE ON vehicles FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =====================================================
-- 6. PARTS TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS parts (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    part_number VARCHAR(50) NOT NULL UNIQUE,
    name VARCHAR(255) NOT NULL,
    description TEXT,
    category VARCHAR(50),
    price DECIMAL(15, 2),
    warranty_months INT DEFAULT 12,
    manufacturer VARCHAR(255),
    model_compatibility VARCHAR(255),
    is_active BOOLEAN DEFAULT TRUE,
    min_stock_level INT DEFAULT 5,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TRIGGER trg_parts_updated_at BEFORE UPDATE ON parts FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =====================================================
-- 7. VEHICLE_PARTS TABLE (Parts installed on vehicles)
-- =====================================================
CREATE TABLE IF NOT EXISTS vehicle_parts (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    vehicle_id BIGINT NOT NULL,
    part_id BIGINT NOT NULL,
    serial_number VARCHAR(100),
    installation_date DATE,
    warranty_start_date DATE,
    warranty_end_date DATE,
    status VARCHAR(20) DEFAULT 'INSTALLED',
    notes TEXT,
    installed_by BIGINT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (vehicle_id) REFERENCES vehicles(id),
    FOREIGN KEY (part_id) REFERENCES parts(id),
    FOREIGN KEY (installed_by) REFERENCES users(id)
);

CREATE TRIGGER trg_vehicle_parts_updated_at BEFORE UPDATE ON vehicle_parts FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =====================================================
-- 8. WARRANTY_POLICIES TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS warranty_policies (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    name VARCHAR(255) NOT NULL UNIQUE,
    description TEXT,
    duration_months INT NOT NULL,
    mileage_limit INT,
    coverage_type VARCHAR(50),
    deductible DECIMAL(10, 2),
    applicable_models VARCHAR(500),
    is_active BOOLEAN DEFAULT TRUE,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TRIGGER trg_warranty_policies_updated_at BEFORE UPDATE ON warranty_policies FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =====================================================
-- 9. WARRANTY_CLAIMS TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS warranty_claims (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    claim_number VARCHAR(50) NOT NULL UNIQUE,
    vehicle_id BIGINT NOT NULL,
    vehicle_part_id BIGINT,
    warranty_policy_id BIGINT,
    failure_description TEXT,
    diagnosis_notes TEXT,
    repair_description TEXT,
    labor_hours DOUBLE PRECISION,
    labor_cost DECIMAL(15, 2),
    parts_cost DECIMAL(15, 2),
    total_cost DECIMAL(15, 2),
    status VARCHAR(30) DEFAULT 'DRAFT',
    mileage_at_claim INT,
    submitted_by BIGINT,
    technician_id BIGINT,
    reviewed_by BIGINT,
    service_center VARCHAR(100),
    rejection_reason TEXT,
    submitted_at TIMESTAMP,
    reviewed_at TIMESTAMP,
    completed_at TIMESTAMP,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (vehicle_id) REFERENCES vehicles(id),
    FOREIGN KEY (vehicle_part_id) REFERENCES vehicle_parts(id),
    FOREIGN KEY (warranty_policy_id) REFERENCES warranty_policies(id),
    FOREIGN KEY (submitted_by) REFERENCES users(id),
    FOREIGN KEY (technician_id) REFERENCES users(id),
    FOREIGN KEY (reviewed_by) REFERENCES users(id)
);

CREATE TRIGGER trg_warranty_claims_updated_at BEFORE UPDATE ON warranty_claims FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =====================================================
-- 10. CLAIM_ATTACHMENTS TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS claim_attachments (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    warranty_claim_id BIGINT NOT NULL,
    file_name VARCHAR(255),
    file_path VARCHAR(500),
    file_type VARCHAR(100),
    file_size BIGINT,
    attachment_type VARCHAR(30),
    description TEXT,
    uploaded_by BIGINT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (warranty_claim_id) REFERENCES warranty_claims(id) ON DELETE CASCADE,
    FOREIGN KEY (uploaded_by) REFERENCES users(id)
);

-- =====================================================
-- 11. SERVICE_CAMPAIGNS TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS service_campaigns (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    campaign_number VARCHAR(50) NOT NULL UNIQUE,
    title VARCHAR(255) NOT NULL,
    description TEXT,
    campaign_type VARCHAR(50),
    status VARCHAR(30) DEFAULT 'DRAFT',
    severity_level VARCHAR(20),
    affected_models VARCHAR(500),
    affected_vins TEXT,
    affected_parts VARCHAR(500),
    remedy_description TEXT,
    estimated_repair_time DOUBLE PRECISION,
    total_affected INT DEFAULT 0,
    completed_count INT DEFAULT 0,
    start_date DATE,
    end_date DATE,
    created_by BIGINT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (created_by) REFERENCES users(id)
);

CREATE TRIGGER trg_service_campaigns_updated_at BEFORE UPDATE ON service_campaigns FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =====================================================
-- 12. INVENTORY TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS inventory (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    part_id BIGINT NOT NULL,
    service_center VARCHAR(100) NOT NULL,
    quantity_on_hand INT DEFAULT 0,
    quantity_reserved INT DEFAULT 0,
    quantity_on_order INT DEFAULT 0,
    reorder_point INT DEFAULT 5,
    location VARCHAR(100),
    last_restock_date TIMESTAMP,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (part_id) REFERENCES parts(id),
    UNIQUE (part_id, service_center)
);

CREATE TRIGGER trg_inventory_updated_at BEFORE UPDATE ON inventory FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =====================================================
-- 13. SERVICE_HISTORY TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS service_history (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    vehicle_id BIGINT NOT NULL,
    service_type VARCHAR(100),
    description TEXT,
    mileage_at_service INT,
    service_date TIMESTAMP,
    completion_date TIMESTAMP,
    service_center VARCHAR(100),
    technician_id BIGINT,
    warranty_claim_id BIGINT,
    service_campaign_id BIGINT,
    labor_hours DOUBLE PRECISION,
    cost DECIMAL(15, 2),
    notes TEXT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (vehicle_id) REFERENCES vehicles(id),
    FOREIGN KEY (technician_id) REFERENCES users(id),
    FOREIGN KEY (warranty_claim_id) REFERENCES warranty_claims(id),
    FOREIGN KEY (service_campaign_id) REFERENCES service_campaigns(id)
);

-- =====================================================
-- 14. AUDIT_LOGS TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS audit_logs (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    username VARCHAR(100) NOT NULL,
    action VARCHAR(100) NOT NULL,
    resource_type VARCHAR(50) NOT NULL,
    resource_id BIGINT,
    details TEXT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

-- =====================================================
-- 15. APPOINTMENTS TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS appointments (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    vehicle_id BIGINT NOT NULL,
    campaign_id BIGINT,
    appointment_date TIMESTAMP NOT NULL,
    status VARCHAR(20) DEFAULT 'SCHEDULED',
    service_center VARCHAR(100),
    notes TEXT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (vehicle_id) REFERENCES vehicles(id),
    FOREIGN KEY (campaign_id) REFERENCES service_campaigns(id)
);

-- =====================================================
-- 16. PART_ALLOCATIONS TABLE
-- =====================================================
CREATE TABLE IF NOT EXISTS part_allocations (
    id BIGINT GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    part_id BIGINT NOT NULL,
    service_center VARCHAR(100) NOT NULL,
    quantity INT NOT NULL,
    status VARCHAR(20) DEFAULT 'PENDING',
    tracking_number VARCHAR(50),
    requested_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    shipped_at TIMESTAMP NULL,
    received_at TIMESTAMP NULL,
    FOREIGN KEY (part_id) REFERENCES parts(id)
);

CREATE TRIGGER trg_part_allocations_updated_at BEFORE UPDATE ON part_allocations FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =====================================================
-- INDEXES FOR PERFORMANCE
-- =====================================================
CREATE INDEX idx_vehicles_vin ON vehicles (vin);
CREATE INDEX idx_vehicles_customer ON vehicles (customer_id);
CREATE INDEX idx_vehicles_status ON vehicles (status);
CREATE INDEX idx_claims_status ON warranty_claims (status);
CREATE INDEX idx_claims_vehicle ON warranty_claims (vehicle_id);
CREATE INDEX idx_claims_number ON warranty_claims (claim_number);
CREATE INDEX idx_parts_number ON parts (part_number);
CREATE INDEX idx_parts_category ON parts (category);
CREATE INDEX idx_campaigns_status ON service_campaigns (status);
CREATE INDEX idx_inventory_part ON inventory (part_id);
CREATE INDEX idx_inventory_center ON inventory (service_center);
CREATE INDEX idx_audit_resource ON audit_logs (resource_type, resource_id);
CREATE INDEX idx_appointments_sc ON appointments (service_center);
CREATE INDEX idx_allocations_sc ON part_allocations (service_center);

